import React, { useEffect, useState } from 'react';

function Getimages() {
  const ACCESS_KEY = 'sL5OjT3ArXKeTik_nUhUsydu5RRNXhCWqHajBMymaW8'; // replace with your Unsplash access key
  const [photos, setPhotos] = useState([]);

  useEffect(() => {
    fetch(`https://api.unsplash.com/photos?client_id=${ACCESS_KEY}`)
      .then(response => response.json())
      .then(data => {
        const parsedData = data.map(photo => {
          return {
            id: photo.id,
            url: photo.urls.thumb,
            user: photo.user.name,
            likes: photo.likes
          };
        });
        setPhotos(parsedData);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h1>Unsplash Gallery</h1>
      {photos.map(photo => (
        <div key={photo.id}>
          <img src={photo.url} alt={photo.id} />
          <p>Photo by {photo.user}</p>
          <p>{photo.likes} likes</p>
        </div>
      ))}
    </div>
  );
}

export default Getimages;
